import React from 'react';
import * as s from './sidebar.styles';

const Sidebar = props => {
    const { backgroundImage } = props;

    

    const header = 'CodeSoft';
    const menuItems = ['Home', 'Porfile', 'Ubication', 'Reports', 'Chat'];
    const menuItemsJSX = menuItems.map((item, index) =>{
        return(
            <s.MenuItem key={index}>{item}</s.MenuItem>
        )
    }) 
    
    return (
        <s.SidebarContainer backgroundImage={backgroundImage}>
            <s.SidebarHeader>{<img src={process.env.PUBLIC_URL + '/LogoW.png'} width="90%" height="90%"></img>}</s.SidebarHeader>
            <s.MenuItemContainer>{menuItemsJSX}</s.MenuItemContainer>
        </s.SidebarContainer>
    )
}

export default Sidebar
